CREATE TABLE IF NOT EXISTS cedants (
    `list_id_oid` VARCHAR(24) CHARACTER SET utf8,
    `list_benefit_percentage` NUMERIC(2, 0),
    `list_code` VARCHAR(5) CHARACTER SET utf8,
    `list_color1` VARCHAR(7) CHARACTER SET utf8,
    `list_color2` VARCHAR(7) CHARACTER SET utf8,
    `list_contact` BIGINT,
    `list_countries_id_oid` VARCHAR(24) CHARACTER SET utf8,
    `list_created_at_date` VARCHAR(24) CHARACTER SET utf8,
    `list_currencies_id_oid` VARCHAR(24) CHARACTER SET utf8,
    `list_email` VARCHAR(33) CHARACTER SET utf8,
    `list_estimation_type` VARCHAR(7) CHARACTER SET utf8,
    `list_groups_cedants_id_oid` VARCHAR(24) CHARACTER SET utf8,
    `list_logo` VARCHAR(75) CHARACTER SET utf8,
    `list_name` VARCHAR(33) CHARACTER SET utf8,
    `list_region_id_oid` VARCHAR(24) CHARACTER SET utf8,
    `list_reinsurances_id_oid` VARCHAR(24) CHARACTER SET utf8,
    `list_types_cedants_id_oid` VARCHAR(24) CHARACTER SET utf8,
    `list_updated_at_date` VARCHAR(24) CHARACTER SET utf8
);
